import React from 'react'
import StreamItems from './StreamItems'

const flex = {
  display: 'flex', 
  justifyContent: 'space-between'
}
const icon = {color: 'gray', marginTop: '10px', cursor: 'pointer'}

const StreamList = (props) => {
  const { streams } = props
  return (
    <div>
      <ul class="collection with-header">
        <li class="collection-header"><div style={flex}><h5>Streams</h5> <a href='#modal1'><i className='small material-icons' style={icon}>add</i></a> </div></li>
        {
          streams.map(stream => (<StreamItems stream={stream} />))
        }
      </ul> 

      <div id="modal1" class="modal">
      <div class="modal-content">
        <h4>Modal Header</h4>
        <p>A bunch of text</p>
      </div>
      <div class="modal-footer">
        <a href="#!" class="modal-close waves-effect waves-green btn-flat">Agree</a>
      </div>
    </div>
  </div>
  )
}

export default StreamList
